import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expences = [
    { title: "Car", price: "28", date: new Date(2021, 2, 4)  }, 
    { title: "Bike", price: "28", date: new Date(2021, 2, 4)  }, 
    { title: "Rickshaw", price: "28", date: new Date(2021, 2, 4)  }, 
    { title: "TukTuk", price: "28", date: new Date(2021, 2, 4)  },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expences[0].title} amount={expences[0].price} date={expences[0].date}></ExpenseItem>
      <ExpenseItem title={expences[1].title} amount={expences[1].price} date={expences[1].date}></ExpenseItem>
      <ExpenseItem title={expences[2].title} amount={expences[2].price} date={expences[2].date}></ExpenseItem>
      <ExpenseItem title={expences[3].title} amount={expences[3].price} date={expences[3].date}></ExpenseItem>
    </div>
  );
}

export default App;
